rule "Veilid Parse RPC Set Value"
when
    starts_with(to_string($message.message), "IN <=== SetValueQ")
then
    set_field("vendor_event_category", "rpc");
    set_field("vendor_event_action", "set");
    set_fields(grok("IN <=== SetValueQ\\(%{GREEDYDATA:veilid_key} #{GREEDYDATA:veilid_subkey} len=%NUMBER:veilid_data_length} seq=%{DATA:veilid_seq} writer=%{GREEDYDATA:veilid_writer}\\) <== %{GREEDYDATA:veilid_sender_node_id}", to_string($message.message), true));
end

rule "Veilid Parse Receipt Details InBand"
when
    has_field("veilid_receipt_details")
    && starts_with(to_string($message.veilid_receipt_details), "InBand")
then
    set_field("veilid_receipt_type", "InBand");
    set_fields(grok("InBand\\(%{GREEDYDATA:veilid_node_id}\\)", to_string($message.veilid_receipt_details), true));
    remove_field("veilid_receipt_details");
end

rule "Veilid Parse Get or Create Connection Retry"
when
    starts_with(to_string($message.message), "get_or_create_connection retries left", true)
then
    // https://gitlab.com/veilid/veilid/-/blob/main/veilid-core/src/network_manager/connection_manager.rs#L360
    set_field("vendor_event_category", "connection");
    set_field("vendor_event_action", "retry");
    set_fields(grok("get_or_create_connection retries left: %{NUMBER:retries_left}", to_string($message.message), true));
end

rule "Veilid Parse RPC Inspect Value"
when
    starts_with(to_string($message.message), "IN <=== InspectValueQ")
then
    // https://gitlab.com/veilid/veilid/-/blob/main/veilid-core/src/rpc_processor/rpc_inspect_value.rs#L207
    set_field("vendor_event_category", "rpc");
    set_field("vendor_event_action", "inspect");
    set_fields(grok("IN <=== InspectValueQ\\(%{GREEDYDATA:veilid_key} {GREEDYDATA:veilid_subkey}\\) <== %{GREEDYDATA:veilid_sender_node_id}", to_string($message.message), true));
end

rule "Veilid Parse No Protocol Handler"
when
    starts_with(to_string($message.message), "no protocol handler for connection from")
then
    // https://gitlab.com/veilid/veilid/-/blob/main/veilid-core/src/network_manager/native/network_tcp.rs#L221
    set_field("vendor_event_category", "network");
    set_field("vendor_event_action", "drop");
    set_field("vendor_event_outcome", "failed");
    set_fields(grok("no protocol handler for connection from %{IPORHOST:remote_ip}:%{NUMBER:remote_port}", to_string($message.message), true));
end

rule "Veilid Parse Connection Debug String"
when
    has_field("veilid_conn_debug")
then
    set_fields(
      grok(
        pattern: "%{IPORHOST:remote_ip}:%{NUMBER:remote_port} <- %{IPORHOST:local_ip}:%{NUMBER:local_port} \\| %{NUMBER:network_connection_id} \\| est %{GREEDYDATA:network_connection_duration} sent %{GREEDYDATA:network_send_duration} rcvd %{GREEDYDATA:network_receive_duration} refcount %{NUMBER:veilid_refcount}", 
        value: to_string($message.veilid_conn_debug), 
        only_named_captures: true
      )
    );
    remove_field("veilid_conn_debug");
end

rule "Veilid Parse Connection Closed"
when
    starts_with(to_string($message.message), "Connection closed", true)
then
    set_field("vendor_event_category", "connection");
    set_field("vendor_event_action", "close");
    set_fields(grok("Connection closed from: %{IPORHOST:remote_ip}:%{NUMBER:remote_port} \\(%{WORD:network_transport}\\)", to_string($message.message), true));
end

rule "Veilid Parse Connection Protect"
when
    starts_with(to_string($message.message), "== PROTECTING connection")
then
    set_field("vendor_event_category", "connection");
    set_field("vendor_event_action", "protect");
    set_fields(grok("== PROTECTING connection: %{NUMBER:veilid_connection_id} -> %{GREEDYDATA:veilid_conn_debug} for node %{GREEDYDATA:veilid_node_id}", to_string($message.message), true));
end

rule "Veilid Parse LRU Kill"
when
    starts_with(to_string($message.message), "== LRU kill connection")
then
    // https://gitlab.com/veilid/veilid/-/blob/main/veilid-core/src/network_manager/connection_manager.rs#L231
    set_field("vendor_event_category", "connection");
    set_field("vendor_event_action", "kill");
    set_fields(grok("== LRU kill connection due to limit: %{GREEDYDATA:veilid_conn_debug}", to_string($message.message), true));
end

rule "Veilid Parse Timestamp Ahead/Behind"
when
    starts_with(to_string($message.message), "Timestamp behind")
    || starts_with(to_string($message.message), "Timestamp ahead")
then
    // https://gitlab.com/veilid/veilid/-/blob/main/veilid-core/src/network_manager/mod.rs#L965
    set_field("vendor_event_category", "time");
    set_field("vendor_event_action", "check");
    set_fields(grok("Timestamp %{WORD:vendor_event_outcome}: %{NUMBER:millis_behind}ms \\(%{WORD:network_transport}:%{IPORHOST:destination_ip}:%{NUMBER:destination_port}\\)", to_string($message.message), true));
end

rule "Veilid Parse Rollback"
when
    starts_with(to_string($message.message), "Rollback (")
then
    set_field("vendor_event_category", "data");
    set_field("vendor_event_category", "rollback");
    set_fields(grok("Rollback \\(%{DATA:veilid_rollback_description}\\): %{NUMBER:veilid_current_value} \\(drop {NUMBER:veilid_uncommited_value}\\)", to_string($message.message), true));
end

rule "Veilid Parse Receipt Details Private"
