    has_field("veilid_receipt_details")
    && starts_with(to_string($message.veilid_receipt_details), "Private")
then
    set_field("veilid_receipt_type", "Private");
    set_fields(grok("Private\\(%{GREEDYDATA:veilid_private_route}\\)", to_string($message.veilid_receipt_details), true));
    remove_field("veilid_receipt_details");
end

