rule "Veilid Parse RPC Failure"
when
    starts_with(to_string($message.message), "couldn't process rpc message")
then
    // https://gitlab.com/veilid/veilid/-/blob/main/veilid-core/src/rpc_processor/mod.rs#L1697
    set_field("vendor_event_category", "rpc");
    set_field("vendor_event_action", "process");
    set_field("vendor_event_outcome", "failed");
    set_fields(grok("couldn't process rpc message:%{GREEDYDATA:vendor_event_outcome_reason}", to_string($message.message), true));
end

rule "Veilid Parse Can't Add Dial Info"
when
    to_string($message.message) == "can not add dial info to this routing domain"
then
    // https://gitlab.com/veilid/veilid/-/blob/main/veilid-core/src/routing_table/routing_table_inner.rs#L167
    set_field("vendor_event_category", "dial_info");
    set_field("vendor_event_action", "add");
    set_field("vendor_event_outcome", "failed");
end

rule "Veilid Parse Get Peer Address Fail"
when
    starts_with(to_string($message.message), "failed to get peer address")
then
    // https://gitlab.com/veilid/veilid/-/blob/main/veilid-core/src/network_manager/native/network_tcp.rs#L117
    set_field("vendor_event_category", "network");
    set_field("vendor_event_action", "resolve");
    set_field("vendor_event_outcome", "failed");
    set_fields(grok("failed to get peer address: %{GREEDYDATA:error_message}", to_string($message.message), true));
end

