    set_field("vendor_event_category", "rpc");
    set_field("vendor_event_action", "watch");
    // set_fields(grok("IN <=== WatchValueQ\\(%{GREEDYDATA:veilid_key} #{GREEDYDATA:veilid_subkey}\\) <== %{GREEDYDATA:veilid_sender_node_id}", to_string($message.message), true));
end

rule "Veilid Parse Commit Over Limit"
when
    starts_with(to_string($message.message), "Commit over limit")
then
    set_field("vendor_event_category", "data");
    set_field("vendor_event_action", "commit");
    set_field("vendor_event_outcome", "failed");
    set_fields(grok("Commit over limit failed \\(%{DATA:veilid_commit_description}\\): %{NUMBER:veilid_uncommited_value} %{NOTSPACE} %{NUMBER:veilid_value_limit}", to_string($message.message), true));
end

rule "Veilid Parse Routing Table Update"
when
    starts_with(to_string($message.message), "Routing table now has", true)
then
    set_field("vendor_event_category", "routing");
    set_field("vendor_event_action", "update");
    set_fields(grok("Routing table now has %{NUMBER:veilid_routing_total_nodes} nodes, %{NUMBER:veilid_routing_live_nodes} live", to_string($message.message), true));
end

rule "Veilid Parse Punish"
when
    starts_with(to_string($message.message), ">>> PUNISHED:")
then
    set_field("vendor_event_category", "punishment");
    set_field("vendor_event_action", "punish");
    // Punishment could be on node or IP
    // node - https://gitlab.com/veilid/veilid/-/blob/main/veilid-core/src/network_manager/address_filter.rs#L327
    // IP - https://gitlab.com/veilid/veilid/-/blob/main/veilid-core/src/network_manager/address_filter.rs#L279
    set_fields(grok(">>> PUNISHED: %{GREEDYDATA:veilid_punished}", to_string($message.message), true));
end

