    starts_with(to_string($message.message), "== New SingleShot Receipt")
then
    set_field("vendor_event_category", "SingleShot");
    set_field("vendor_event_action", "receive");
    set_fields(grok("== New SingleShot Receipt %{GREEDYDATA:veilid_receipt_nonce}", to_string($message.message), true));
end

rule "Veilid Parse Receipt"
when
    starts_with(to_string($message.message), "<<== RECEIPT")
then
    // https://gitlab.com/veilid/veilid/-/blob/main/veilid-core/src/network_manager/receipt_manager.rs#L415
    set_field("vendor_event_category","rpc");
    set_field("vendor_event_action", "receive");
    set_fields(grok("<<== RECEIPT %{DATA:veilid_receipt_nonce} <- %{GREEDYDATA:veilid_receipt_details}", to_string($message.message), true));
end

