    set_field("vendor_event_category", "route");
    set_field("vendor_event_action", "test");
    set_field("vendor_event_outcome", "failed");
    set_fields(grok("Dead route failed to test: %{GREEDYDATA:veilid_route}", to_string($message.message), true));
